  return (
    <div style={{ display: 'flex' }}>
      <CssBaseline />
      <Sidebar />
      <main style={{ flexGrow: 1, padding: '20px' }}>
        <MainPageContent />
      </main>
    </div>
  );
};

export default MainPage;
